import User from "./User";
import UserPost from "./components/UserPost";
// import './App.css';
import {Browser as Route,Router,Routes,Navigate} from 'react-router-dom';



const App = () => {
//   return(<User />);
<>
    <Router>
        <Routes>
            <Route path="/" element={<User />} />
            <Route path="/User-post" element={<UserPost/>}/>
        </Routes>
    </Router>
</>
};

export default App;
